export default (function(a,b,c,d,e){return {data:{vTQGjl1v2w:{data:{id:173,attributes:{imdbId:"tt0062673",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BYTdkZjg0YjktODg2MC00OWJhLTgxYjAtMjM3NTI0NTRkZTI0L2ltYWdlL2ltYWdlXkEyXkFqcGdeQXVyNzc5MjA3OA@@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"6.0\u002F10"},{Source:"Rotten Tomatoes",Value:"67%"}],item_lang:{data:{id:836,attributes:{title:d,plot:"Allied forces land at Anzio unopposed, but instead of moving inland and north to Rome, their commanding officer decides to dig in. A battle-hardened war correspondent borrows a jeep and driver and drives to Rome and back encountering no significant German forces. The report on the absence of the enemy is discounted as the general is concerned about having the strength to hold Anzio and support the offensive. By the time it is finally decided to make a move the Germans have arrived in strength. A US Ranger assault on Cisterna is ambushed with most of the forces killed or captured. A small group of survivors, including the war correspondent, struggle to make their way back to Anzio and report on the German defenses.",slug:"anzio"}}},books:{data:[{id:2466,attributes:{title:d,description:"The explosive story of World War II’s bloodiest beachhead—where everything failed but courage. ‘THIS IS A BASTARD OF A PLACE...’ said a soldier on the Anzio beachhead. This was the bitter truth. What started as an easy victory turned abruptly into a massacre. Over 18,000 Allied soldiers were wounded and 4,400 killed in the early months of 1944 First published in 1961, this book, by a man who was there to the very end, tells the whole, shocking story. “Explains in vivid detail...what the soldiers...and one general can be proud of and what other generals need to explain.”—LIFE “Must reading”—New York Times",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=Zg0qDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:true,published:"2017-06-28",publisher:"Pickle Partners Publishing",subtitle:a}},{id:2467,attributes:{title:d,description:a,thumbnail:a,authors:[b],firstBook:c,published:e,publisher:a,subtitle:a}},{id:2468,attributes:{title:"Anzio. [Mit Illustr. U. Kt. -Skizzen.] (1. Publ.)",description:"Beskrivelse af de Allierede styrkers landgang ved Anzio og kampene i Italien, 1943-1944. Landgangen ved Anzio og kampene der regnes som nogle af 2. Verdenskrig's hårdeste og blodigste",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=DPjG583ZZ1QC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:c,published:"1961-01-01",publisher:"[London] : Longmans [1961]",subtitle:a}},{id:2469,attributes:{title:"Anzio, Etc. [With Plates.].",description:a,thumbnail:a,authors:["Wynford Vaughan THOMAS"],firstBook:c,published:e,publisher:a,subtitle:a}},{id:2470,attributes:{title:"The Princes of Wales",description:"Describes the lives of the twenty-one princes of Wales ranging from the first in the fourteenth century to the present, Charles, Prince of Wales",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=KkoYDGx2I4sC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:c,published:"1982-01-01",publisher:"Beaufort Books",subtitle:a}}]}}},meta:{}}},prerenderedAt:1680940913594}}("","Wynford Vaughan-Thomas",null,"Anzio","1963-01-01"))